import React from 'react';
import Omnitone from 'omnitone';
import 'aframe';
import {Entity, Scene} from 'aframe-react';

class OmnitonePlayer extends React.Component {

  handleClick = () => {
    console.log('clicked!');
  }

  render () {
    return (
      <Entity primitive='a-box' color="green" position="0 3 -5" events={{
        click: this.handleClick
      }}/>
    )
  }
}

export default OmnitonePlayer;
